import React from 'react'

export default function Login() {
  return (
    <div className='flex justify-center '>
      <h1>BLESSING</h1>

        <h2>LOGIN</h2>

        <form action="Login">
            <label htmlFor="email"></label>
            <label htmlFor="password"></label>
        </form>
    </div>
  )
}
